  <style>
    .custom-btn {
      width: 130px;
      height: 40px;
      color: #fff;
      border-radius: 5px;
      padding: 10px 25px;
      font-family: 'Lato', sans-serif;
      font-weight: 500;
      background: transparent;
      cursor: pointer;
      transition: all 0.3s ease;
      position: relative;
      display: inline-block;
      box-shadow: inset 2px 2px 2px 0px rgba(255, 255, 255, .5), 7px 7px 20px 0px rgba(0, 0, 0, .1), 4px 4px 5px 0px rgba(0, 0, 0, .1);
      outline: none;
    }

    .btn-11 {
      border: white;
      background: green;
      background: linear-gradient(80deg, yellow 0%, teal 90%);
      color: #fff;
      overflow: hidden;
    }

    .btn-11:hover {
      text-decoration: none;
      color: #fff;
      background-image: linear-gradient(135deg, teal 0%, yellow 64%);
    }

    .btn-11:before {
      position: absolute;
      content: '';
      display: inline-block;
      top: -180px;
      left: 0;
      width: 30px;
      height: 100%;
      background-color: #fff;
      animation: shiny-btn1 3s ease-in-out infinite;
    }

    .btn-11:hover {
      opacity: .7;
      color: white;
    }

    .btn-11:active {
      box-shadow: 4px 4px 6px 0 rgba(255, 255, 255, .3), -4px -4px 6px 0 rgba(116, 125, 136, .2), inset -4px -4px 6px 0 rgba(255, 255, 255, .2), inset 4px 4px 6px 0 rgba(0, 0, 0, .2);
    }

    @-webkit-keyframes shiny-btn1 {
      0% {
        -webkit-transform: scale(0) rotate(45deg);
        opacity: 0;
      }

      80% {
        -webkit-transform: scale(0) rotate(45deg);
        opacity: 0.5;
      }

      81% {
        -webkit-transform: scale(4) rotate(45deg);
        opacity: 1;
      }

      100% {
        -webkit-transform: scale(50) rotate(45deg);
        opacity: 0;
      }
    }

    @import url("https://fonts.googleapis.com/css?family=Roboto");

    @-webkit-keyframes come-in {
      0% {
        -webkit-transform: translatey(100px);
        transform: translatey(100px);
        opacity: 0;
      }

      30% {
        -webkit-transform: translateX(-50px) scale(0.4);
        transform: translateX(-50px) scale(0.4);
      }

      70% {
        -webkit-transform: translateX(0px) scale(1.2);
        transform: translateX(0px) scale(1.2);
      }

      100% {
        -webkit-transform: translatey(0px) scale(1);
        transform: translatey(0px) scale(1);
        opacity: 1;
      }
    }

    @keyframes come-in {
      0% {
        -webkit-transform: translatey(100px);
        transform: translatey(100px);
        opacity: 0;
      }

      30% {
        -webkit-transform: translateX(-50px) scale(0.4);
        transform: translateX(-50px) scale(0.4);
      }

      70% {
        -webkit-transform: translateX(0px) scale(1.2);
        transform: translateX(0px) scale(1.2);
      }

      100% {
        -webkit-transform: translatey(0px) scale(1);
        transform: translatey(0px) scale(1);
        opacity: 1;
      }
    }

    * {
      margin: 0;
      padding: 0;
    }

    html,
    body {
      background: #ffffff;
      font-family: 'Roboto', sans-serif;
    }

    .stwBlurRainbow,
    .stwRainbow {
      position: fixed;
      width: 100%;
      bottom: 0;
      left: 0;
      right: 0;
      height: 4px;
      z-index: 23;
      background: linear-gradient(-45deg, #4086f4, #31a952, #fbbe01, #eb4132, #4086f4, #31a952, #fbbe01, #eb4132);
      background-size: 200%;
      -webkit-animation: animeBar 5s linear infinite;
      animation: animeBar 5s linear infinite
    }

    .stwBlurRainbow {
      height: 13px;
      z-index: 22;
      filter: blur(10px);
      opacity: .7
    }

    @-webkit-keyframes animeBar {
      0% {
        background-position: 0 50%
      }

      50% {
        background-position: 100% 50%
      }

      100% {
        background-position: 0 50%
      }
    }

    @keyframes animeBar {
      0% {
        background-position: 0 50%
      }

      50% {
        background-position: 100% 50%
      }

      100% {
        background-position: 0 50%
      }

      .footer {
        position: fixed;
        bottom: 0;
        left: 50%;
        transform: translateX(-50%);
        text-align: center;
        background-color: #fff;
        padding: 10px;
        width: 100%;
      }
    }
  </style>
